export const Header = () => {

  const productData = useSelector((state)=> state.bazar.productData)

    return (
      <div className="">
         <Link to='/'>
            <div>
              <img src={''} alt="LogoLight"  />
            </div>
         </Link>
        <div className=''>
          <ul className=''>
            <Link to={'/'}><li className=''>Home</li></Link>
          </ul>
        </div>
        <Link to='/cart'>
          <div className='cursor-pointer relative'>
          <ShoppingCartIcon/>
          <span className="">{productData.length}</span>
          </div>
        </Link>

      </div>
    )
  }
